/*Table structure for table `sd_rendicion_devolucion` */

DROP TABLE IF EXISTS `sd_rendicion_devolucion`;

CREATE TABLE `sd_rendicion_devolucion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `clave_rendicion` varchar(20) DEFAULT NULL,
  `ord_pago_1` varchar(20) DEFAULT NULL COMMENT 'orden de pago 1',
  `ord_pago_2` varchar(20) DEFAULT NULL COMMENT 'orden de pago 2',
  `fec_trans_1` date DEFAULT NULL COMMENT 'fecha transferencia 1',
  `fec_trans_2` date DEFAULT NULL COMMENT 'fecha transferencia 2',
  `cheque` int(11) DEFAULT NULL COMMENT 'cheque',
  `importe_transferido` decimal(10,2) DEFAULT NULL COMMENT 'Importe pagado al prestador neto de retenciones con el dinero recibido en concepto de subsidio',
  `ret_ganancias` decimal(10,2) DEFAULT NULL COMMENT 'Retención de ganancias',
  `ret_iibb` decimal(10,2) DEFAULT NULL COMMENT 'Retenciones de IIBB',
  `otras_retenciones` decimal(10,2) DEFAULT NULL COMMENT 'Otras retenciones',
  `imp_aplicado_sss` decimal(10,2) DEFAULT NULL COMMENT 'Aplicacion del dinero recibido por parte de la SSSALUD.',
  `imp_propios_ing` decimal(10,2) DEFAULT NULL COMMENT 'Fondos de la O.S. ingresados a la cuenta Discapacidad para el pago de prestaciones',
  `imp_propios_otra_cuenta` decimal(10,2) DEFAULT NULL COMMENT 'Fondos de la O.S. transferidos al prestador desde una cuenta distinta a la de Discapacidad para el pago de prestaciones',
  `nro_recibo` int(11) DEFAULT NULL,
  `imp_trasladado` decimal(10,2) DEFAULT NULL COMMENT 'Importe recibido por la SSSALUD y no utilizado para la cobertura de prestaciones, debido a que se ha detectado un error en la información enviada por la O.S. y se debe corregir en el próximo envío.',
  `imp_devuelto_cuenta_sss` decimal(10,2) DEFAULT NULL COMMENT 'Importe devuelto a la SSSALUD',
  `saldo_no_aplicado` decimal(10,2) DEFAULT NULL COMMENT 'Recupero de fondos propios de la O.S',
  `recupero_fondos_propios` decimal(10,2) DEFAULT NULL,
  `observaciones` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=112 DEFAULT CHARSET=utf8;

